import './App.css';


function Box(props){
  return(
    <div className='Box'>
      X
    </div>
  );
}

function Row(props){
  return(
    <div className='Row'>
        <Box></Box>
        <Box></Box>
        <Box></Box>
        <Box></Box>
    </div>
  )
}

function Diagram(props){
  return(
    <div className='Diagram'>
        <Row></Row>
        <Row></Row>
        <Row></Row>
        <Row></Row>
        <Row></Row>
        <Row></Row>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">


        <p>

          Edit <code>src/App.js</code> and save to reload.

        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <body className="Body">
        <Diagram></Diagram>
        <p>
          text
        </p>
      </body>
    </div>
  );
}



export default App;
